import unittest
from parameterized import parameterized
from stringstoanagrams import anagram

class StringsToAnagramsTest(unittest.TestCase):

  @parameterized.expand([
    ("short string length 6", "aaabbb", 3),
    ("short string length 2", "ab", 1),
    ("short string of odd length", "abc", -1),
    ("short string length 4", "mnop", 2),
    ("short string length 4 with anagram", "xyyx", 0),
    ("short string length 4 with one mismatch", "xaxbbbxx", 1)
  ])
  def test_anagram_distance(self, name, input_value, expected):
    self.longMessage = True
    actual = anagram(input_value)
    message = 'For input {0}, expected value = {1}, and actual value = {2}'.format(input_value, expected, actual)
    self.assertEqual(expected, actual, message)

  @parameterized.expand([
    ("short string of odd length", "abc", -1),
    ("short string of odd length", "abcdedcba", -1)
  ])
  def test_anagram_boundary_checks(self, name, input_value, expected):
    self.longMessage = True
    actual = anagram(input_value)
    message = 'For input {0}, expected value = {1}, and actual value = {2}'.format(input_value, expected, actual)
    self.assertEqual(expected, actual, message)

  @parameterized.expand([
    ("random string length 10000", "", 191),
    ("random string length 10000", "", 216),
    ("random string length 10000", "", 198),
    ("random string length 10000", "", 180),
    ("random string length 10000", "", 166),
    ("random string length 10000", "", 205),
    ("random string length 10000", "", 171),
    ("random string length 10000", "", 213),
    ("random string length 10000", "", 138),
    ("random string length 10000", "", 152)
  ])
  def test_anagram_long_strings(self, name, input_value, expected):
    self.longMessage = True
    actual = anagram(input_value)
    message = 'For input {0}, expected value = {1}, and actual value = {2}'.format(input_value, expected, actual)
    self.assertEqual(expected, actual, message)